import React from "react";

//Style


function Table() {
  return (
    <div className="table-container">

        <table>

            <thead>

                <tr>

                    <th>ID</th>
                    <th>R.Date</th>
                    <th>State</th>
                    <th></th>

                </tr>

            </thead>

        </table>

    </div>
  );
}

export {Table};
